import "./App.css";
import { useState } from "react";

function App() {

  const time = new Date()
  const [count, setCount] = useState(0);

  function inc() {
    setCount(count + 10);
  }
  return (
    <div className="App">


      <h1>{count}</h1>
      <button onClick={inc}>Click me</button>


    </div>
  );
}

export default App;
